import React from 'react';
import { Link } from "react-router-dom";

import '../css/Home.css';
import '../css/Bootstrap.css';
import Background from '../img/blueBack.png';




class Home extends React.Component{
  renderPanels(buttonTitle, logo){
    return(
      <div className="col-md home panel">
        <div>
          <img className="icon" src={logo} />
        </div>
        <Link to='/about'><button type="button" className="btn btn-primary btn-lg button">{buttonTitle}</button></Link>
      </div>
    );
  }

  render(){
    const aboutLogo = require('../img/notebook.png');
    const blogLogo = require('../img/blog.png');
    const mailLogo = require('../img/mail.png');
    document.body.style = `background-image: url(${Background}); background-size: cover;background-attachment:fixed;background-position:center; `;
    return(
      <div>
      <nav class="navbar navbar-light bg-light">
        <a class="navbar-brand" href="#">Concussion Competencies</a>
      </nav>
        <p>A framework</p>
        <div className="container">

          <div className="row row align-items-center">
            {this.renderPanels('Learn More', aboutLogo)}
            {this.renderPanels('Blog', blogLogo)}
            {this.renderPanels('Contact Us', mailLogo)}
          </div>
        </div>
      </div>
    );
  };
}

export default Home;
